- request:
    body: '{"messages":[{"role":"system","content":"You are a legal knowledge management
      specialist. Your task is to create a concise 2-3 sentence summary of a contract
      that will help paralegals quickly find this document in a search index. Include
      specific details like party names, dates, and particular context while maintaining
      clarity. Focus on what makes this contract unique and identifiable."},{"role":"user","content":"            Based
      on the following detailed contract summary, create a 2-3 sentence summary\n            that
      would help paralegals quickly identify this specific contract in a search.\n            Include
      proper names, dates, and specific context where available. The summary\n            should
      be both accurate and distinctive enough to differentiate this contract\n            from
      similar ones.\n\n            Detailed Summary:\n            # Contract Analysis
      Summary\n\n## 1. Context and Purpose\nThe primary purpose of the contract is
      to establish a formal agreement between the parties regarding the provision
      of specific services or goods. This contract aims to outline the responsibilities,
      expectations, and legal obligations of each party involved, ensuring clarity
      and mutual understanding to facilitate a successful business relationship.\n\n##
      2. Knowledge Base Article Summary\n\n### Parties Involved\n- **Party A**: [Name/Role]
      - Responsible for [specific obligations or services].\n- **Party B**: [Name/Role]
      - Obligated to [specific responsibilities or contributions].\n\n### Key Dates\n-
      **Effective Date**: [Date] - The date on which the contract becomes enforceable.\n-
      **Milestones**: [List any significant milestones with corresponding dates].\n-
      **Deadlines**: [List any critical deadlines for deliverables or actions].\n-
      **Renewal Dates**: [Specify any dates related to renewal options or terms].\n\n###
      Key Definitions\n- **\"Services\"**: Refers to [specific services defined in
      the contract].\n- **\"Deliverables\"**: Items or outcomes that must be provided
      by [Party A/B].\n- **\"Confidential Information\"**: Any proprietary information
      shared between the parties.\n\n### Termination & Renewal Provisions\n- **Termination
      Clause**: The contract may be terminated by either party under specific conditions,
      such as [list conditions, e.g., breach of contract, failure to perform].\n-
      **Renewal Clause**: The contract may be renewed automatically unless either
      party provides written notice of intent not to renew at least [number of days]
      prior to the expiration date.\n\n## 3. Notes on Referenced Documents & Regulations\n\n###
      Referenced Documents\n- **Document Title**: [Name of the document] - [Date,
      version, or relevant sections].\n- **Additional Documents**: [List any other
      relevant documents with details].\n\n### Referenced Rules/Regulations\n- **Regulation
      Name**: [Name of the law or regulation] - This applies to [describe how it relates
      to the contract].\n- **Governing Body**: [Name of the regulatory body] - Responsible
      for overseeing compliance with [specific regulations mentioned]. \n\n---\n\n*Note:
      The placeholders in brackets should be filled with specific information from
      the actual contract text for a complete analysis.*\n            "}],"model":"gpt-4o-mini","stream":false,"temperature":0.1}'
    headers:
      accept:
